sys_variable_value.value:
(function execute(inputs, outputs) {

    var response = false;

    var obj = new UpdateStorage();

    response = obj.updateStorageHistory(inputs.paremeter_material, inputs.paremeter_solicitante, inputs.paremeter_quantidade);

    outputs.paremeter_response = response;

})(inputs, outputs);

